import { useCategoriesContext } from '../hooks/usePostListContext'
import axios from 'axios';

interface Category {
    category_id: string;
    content: string;
    title: string;
    post_img: string;

}

const Home: React.FC = () => {



    const posts = useCategoriesContext();


    useEffect(() => {
        const fetchData = async () => {
            try {
                const response = await axios.get<Category[]>('http://localhost:3001/api/posts/');
                setPosts(response.data);
            } catch (error) {
                console.error('Error fetching data:', error);
            }
        };

        fetchData();
    }, []);

  return (
    <div>Home</div>

  )
}

